window.bookSummaryJSON = "<p>War veteran, Tabitha Masters, expected to live out the rest of her days with the debilitating scars of battle. But, after her crew made a deal with the devil (<i>Smuggler's Dilemma</i>, Privateer Tales Book Five), she's been given a second chance. A month in a medical tank and Tabby's injuries are repaired, replaced and even upgraded. </p> <p>Within hours of being discharged from the hospital, Tabby hears from Shri Ganguly - a fellow veteran and survivor of the Red Houzi war. Shri is convinced she's being targeted and hopes that Tabby can help. </p> <p>It will take everything Tabby has to recover, while facing down the danger that threatens her friend. </p>"; 
